import {Direction} from "../models/common";

export class Images {
  public static getRandomImage(): string {
    return ImagesPaths[Math.floor(Math.random() * Math.floor(ImagesPaths.length))];
  }

  public static getDrawerImages(index: string, active: boolean): ImageInfo {
    let img = DrawerImagesAsBase64.find((img)=>Direction[img.direction] === Direction[index]&&img.isActive===active);
    return img;
  }
}

